import './Home.css';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <>
      <div>
        <div>
         <Link to="/"><p className="logo" >lulu school</p></Link>
        </div>
      </div>
    </>
  );
}

export default Home;
